// Get all items from the "Edit Image" node
const editImageItems = $items("Edit Image", 0, 0);

if (!editImageItems || editImageItems.length === 0) {
  throw new Error("No items found from Edit Image node");
}

// Get the binary data from the edited image
const binary = editImageItems[0].binary?.data || editImageItems[0].binary?.image || editImageItems[0].binary?.Upload_product;

if (!binary) {
  throw new Error("No binary file found in Edit Image node output");
}

// Return in proper structure for next node (like OpenAI Analyze Image)
return [
  {
    json: {},
    binary: {
      image: binary
    }
  }
];
